    <div class="col-md-12 kt--margin-bottom-10-mobile" *ngIf="data.YeuCauCapPhatTaiSan.IdYC > 0">
        <h5>Thông tin duyệt</h5>
        <hr>
      </div>
      <div class="row align-items-center khung-container" style="justify-content: center;">
        <div class="col-md-3 khungboder khung" *ngFor="let item of listData_CapDuyet">
          <div style="text-align: center; border-bottom: solid 1px darkgray;
          font-size: 13pt;font-weight: bold;"><span>{{item.title}}</span>
          </div><br />
          <div>
            <mat-form-field class="mat-form-field-fluid">
              <input style="text-align: center" matInput value="{{f_duyet(item)}}" readonly="true">
            </mat-form-field>
          </div><br />
          <div class="row" style="font-size: 11pt;">
            <div class="col-md-6 ">Ngày duyệt</div>
            <div class="col-md-8 khung-tieude"><span>{{f_date(item.CheckedDate)}}</span></div>
          </div><br />
          <div class="row" style="font-size: 11pt;">
            <div class="col-md-6 ">Người duyệt</div>
            <div class="col-md-8 khung-tieude"><span>{{item.hoten}}</span></div>
          </div>
        </div>
        <div class="col-md-3 khungboder khung" *ngIf="listData_ApprovingUser.length > 0">
          <div
            style="text-align: center; border-bottom: solid 1px darkgray;font-size: 13pt;font-weight: bold;">
            <span>{{vitriduyet}}</span>
          </div><br />
          <div class="row" style="justify-content: center">
            <!-- <button mat-raised-button type="button" color="accent" (click)="KyDuyet()" *ngIf="showKyDuyet"
              [disabled]="enableBT && disabledBtn" matTooltip="{{thongbao}}">
              <span translate="Ký duyệt"></span>&nbsp;&nbsp;<div *ngIf="disabledBtn"
                class="spinner-button-pad"></div>
            </button>&nbsp; -->
            <button mat-raised-button type="button" color="accent" (click)="UpdateTrangThai(1)"
              [disabled]="enableBT && disabledBtn" matTooltip="{{thongbao}}">
              Duyệt&nbsp;&nbsp;<div *ngIf="disabledBtn" class="spinner-button-pad"></div>
            </button>&nbsp;<button mat-raised-button type="button" color="warn"
              (click)="UpdateTrangThai(2)" [disabled]="enableBT && disabledBtn">
              Không duyệt&nbsp;&nbsp;<div *ngIf="disabledBtn" class="spinner-button-pad"></div>
            </button>
          </div><br />
          <div class="row" style="font-size: 11pt;">
            <div class="col-md-6 ">Người duyệt</div>
            <div class="col-md-8 khung-tieude"><span>{{tennguoiduyet}}</span></div>
          </div>
        </div>
      </div>
